import React, { Component } from 'react';
import './App.css';

class Login extends Component {
  render() {
    return (

      <div className="Login">
        <head>
          <title>
            SUTD Scheduler | Timetable
          </title>
        </head>

        <body>
          //extends template .html
          //block content

          <h1>Login</h1>

          <form action="" method="post">
              <input type="text" placeholder="Username" value="{{request.form.username}}">
              </input>
              <input type="text" placeholder="Password" value="{{request.form.password}}">
              </input>
              <input class="btn btn-default" type="submit" value="Login">
              </input>

          </form>
        </body>

      </div>

    );
  }
}

export default Login;
